import React, { useState } from 'react';

function Team({ Agenre, Bgenre, Cgenre, onChange }) {
  const candidates = [
    '민식',
    '무현',
    '대중',
    '기철',
    '회영',
    '민솔',
    '성묵',
    '희선',
    '대희',
    '영미',
    '소영',
    '알라',
  ];

  const [teamA, teamB, teamC] = useState(null);

  const makeCandidates = (array) => {
    const newCandidates = array.sort((a, b) => {
      return parseInt(Math.random() * 10) - 5;
    });
    return newCandidates;
  };

  const onClick = () => {
    let newCandi = makeCandidates(candidates);
  };

  return (
    <>
      <div>
        {Agenre}팀: {teamA}
        <br />
        {Bgenre}팀: {teamB}
        <br />
        {Cgenre}팀: {teamC}
      </div>
      <button onClick={onClick}>Mix</button>
    </>
  );
}

export default Team;
